INSERT INTO `bands` (`id`, `name`, `photo`, `description`, `created_at`, `updated_at`, `country`) VALUES (498, 'Lucifer`s Friend', '', 'Prog. Lucifer\'s Friend was a 1970s German Rock band. Allmusic author, Eduardo Rivadavia, noted the group as, early practitioners of heavy metal and progressive rock. With UH\'s singer John Lawton;2\r\n190;Lucyfire;SE;Doom Gothic Metal. Spin-off from Tiamat;11\r\n191;Magma;FR;Prog. Zeuhl;23\r\n192;Mago de Oz;ES;Symphonic Metal;7\r\n193;Mahavishnu Orchestra;US;Jazz Rock/Fusion / Progressive Rock artist from Multi-National;17\r\n194;Malibran;IT;Symphonic Metal;7\r\n195;Manfred Mann\'s Earth Band;UK;Classic Rock;1\r\n196;Marco Antonio Araujo;BR;Prog artist from Brazil. Folk / Progressive Rock;2\r\n197;Marillion;UK;Prog;2\r\n198;Mark Farner;US;Classic Rock singer from Grand Funk;1\r\n199;Mekong Delta;DE;Progressive Metal + Thrash;8\r\n200;Memento Mori;SE;Doom Metal;11\r\n201;Memoriance;FR;Prog. Symph. MEMORIANCE is a unique sounding French symphonic progressive band from the 1970s who released 2 albums and a 7 single.', '0000-0-0 00:00:00', '0000-0-0 00:00:00', 'DE');
