INSERT INTO `bands` (`id`, `name`, `photo`, `description`, `created_at`, `updated_at`, `country`) VALUES (522, 'Pan', '', 'Prog. Psychedelic. Pan were a Danish prog/psych/blues rock band from the early 1970s consisting of musicians Robert Lelievre, Thomas Puggaard-Müller, Henning Verner, Arne Würgler, Michael Puggaard-Müller, and in the group\'s 2nd incarnation: Jens Elbøl, Torben Enghoff, and Nils Tuxen. Several of these musicians are still playing regular live shows in various different bands, such as Troels Jensen & Kenn Lending Blues Band, Somanden Og Stjernerne, and Survivors.\nSites:\npanrobertlelievre.com', '0000-0-0 00:00:00', '0000-0-0 00:00:00', 'DK');
