INSERT INTO `bands` (`id`, `name`, `photo`, `description`, `created_at`, `updated_at`, `country`) VALUES (536, 'Procession', '', 'Prog. PROCESSION formed in Turin in 1972. They came out that same year with an album titled Frontiera for the small Help label (an RCA subsidiary that also released QUELLA VECCHIA LOCANDA\'s first album). This record is particularly interesting for the lyrics that dealt with immigration. Musically the style is rather acoustic', '0000-0-0 00:00:00', '0000-0-0 00:00:00', 'IT');
